import { Component } from '@angular/core';

@Component({
  selector: 'testing',
  templateUrl: './test.component.html',
  styleUrls: ['./test.component.css']
})
export class TestComponent {
   public name: string = "ladzani";
   public textColor = false;
   public cFont = "control-font";
   public displayList = undefined;

   public testSwitchStatement = "";

   public arrayList: number[] = [1, 3,5,7,9,2,4,6,8];

   changeColor(){
    this.textColor = !this.textColor;
    //this.displayList = !this.displayList;
   }
}
